css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url("http://eden.fallengalaxy.com/"),
               url("http://gaia.fallengalaxy.com/") {
#toolbar {
  background-image: url("data:image/png;base64,") !important;
  width: 240px !important;
}
#progressBar,
#progressBar .container,
#progressBar .content,
#progressBar .outlineText,
#progressBar .barLabel {
  margin: 0px !important;
  width: 160px !important;
}
#progressBar {
  position: absolute !important;
  top: 0px !important;
  left: 255px !important;
  width: 222px !important;
  margin: 0px !important;
  background-image: url("data:image/png;base64,") !important;
  background-position: 0px 0px !important;
}
#progressBar .container {
  margin-top: 3px !important;
  margin-left: 4px !important;
  background-image: url("data:image/png;base64,") !important;
  background-position: 0px 0px !important;
  background-repeat: no-repeat !important;
}
.lowres #progressBar .currentProgress, #progressBar .currentProgress {
  background-image: url("data:image/png;base64,") !important;
  background-position: 0px 0px !important;
  background-repeat: no-repeat !important;
}
.miniMap {
  position: absolute !important;
  top: 0px !important;
  right: 0px !important;
  left: auto !important;
  bottom: auto !important;
  margin: 0px !important;
  height: 176px !important;
  width: 160px !important;
  padding: 0px !important;
  padding-left: 18px !important;
  background-image: url("data:image/png;base64,") !important;
  background-position: top right !important;
}
#namePanel {
  position: absolute !important;
  top: 0px !important;
  right: 178px !important;
  left: auto !important;
  bottom: auto !important;
  margin: 0px !important;
  height: 41px !important;
  width: 158px !important;
  padding: 0px !important;
  padding-left: 60px !important;
  padding-top: 3px;
  background-image: url("data:image/png;base64,") !important;
  background-position: 0px !important;
  background-repeat: no-repeat !important;
}
#selectionInfo {
  bottom: -4px !important;
  left: auto !important;
  right: 0px !important;
  width: 160px !important;
  height: 160px !important;
  padding-top: 16px !important;
  padding-left: 12px !important;
  background-image: url("data:image/png;base64,") !important;
  background-position: bottom right !important;
  background-color: transparent !important;
}
#controlPanel {
  left: 0px !important;
  bottom: 0px !important;
  width: 306px !important;
  height: 102px !important;
  padding-top: 12px !important;
  padding-bottom: 1px !important;
  padding-right: 8px !important;
  background-image: url("data:image/png;base64,") !important;
  background-position: bottom left !important;
  opacity: 0.6;
}
#controlPanel:hover {
  opacity: 1;
}
#missionPanel {
  position: absolute !important;
  top: 190px !important;
}
#chat {
  position: absolute !important;
  left: -140px !important;
  bottom: 0px;
}
#lagometer {
  top: auto !important;
  bottom: 10px !important;
  z-index: 100000;
}

.lowres #toolbar {
  background-image: url("data:image/png;base64,") !important;
}
.lowres .miniMap {
  height: 136px !important;
  width: 120px !important;
  background-image: url("data:image/png;base64,") !important;
}
.lowres #namePanel {
  right: 138px !important;
  background-position: top right !important;
  background-image: url("data:image/png;base64,") !important;
}
.lowres #missionPanel {
  top: 150px !important;
}
.lowres #selectionInfo {
  width: 120px !important;
  height: 120px !important;
  background-image: url("data:image/png;base64,") !important;
}

}
